import './App.css';
import { BrowserRouter as Router, Routes,Route } from 'react-router-dom';
import Dashboard from './admin/Dashboard';
import Appointment from './components/Appointment';
import VisitorDashboard from './components/appointment/VisitorDashboard';
import Signup from './components/Signup';
import Home from './components/Home';
import Login from './components/Login';
import Appointments from './admin/Appointments';
import MyAppointments from './components/MyAppointments';
import AddAppointments from './admin/AddReports';
import AddReports from './admin/AddReports';
import MyReports from './components/MyReports';
import AddTestResult from './admin/AddTestResult';
import MyTestResults from './components/MyTestResults';
import AllTestResults from './admin/AllTestResults';
import AdminLogin from './admin/Login';
import ProtectedRoute from './ProtectedRoute'; // Import the ProtectedRoute component

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/appointment" element={<Appointment />} />
          <Route path="/login" element={<Login />} />
          <Route path="/registration" element={<Signup />} />

          <Route path="/admin-login" element={<AdminLogin />} />
          <ProtectedRoute path="/admin-dashboard" element={<Dashboard />} /> {/* Protect this route */}
          <ProtectedRoute path="/appointments" element={<Appointments />} /> {/* Protect this route */}
          <ProtectedRoute path="/my-appointments" element={<MyAppointments />} /> {/* Protect this route */}

          <ProtectedRoute path="/add-reports" element={<AddReports />} /> {/* Protect this route */}
          <ProtectedRoute path="/my-reports" element={<MyReports />} /> {/* Protect this route */}
          <ProtectedRoute path="/add-test-result" element={<AddTestResult />} /> {/* Protect this route */}

          <ProtectedRoute path="/my-test-result" element={<MyTestResults />} /> {/* Protect this route */}
          <ProtectedRoute path="/all-test-result" element={<AllTestResults />} /> {/* Protect this route */}
        </Routes>
      </Router>
    </div>
  );
}

export default App;
